import { useEffect, useState } from "react"


const Profile = () => {

    const [user, setUser] = useState({})
    useEffect(() => {
        profile().then((user) => {
            setUser(user)
        }).catch((err) => { console.log(err); })
    })
    return (
        <Base title="Profile">
            {{ user }}
        </Base>
    )
}

export default Profile;
